style.css:
@-moz-document domain("jovemnerd.com.br") {

body.light-skin {
    background-color: #1e1e22 !important;
    color: #8c8c96 !important;
}

body.light-skin .entry-card__content-title a {
    color: #8c8c96 !important;
}

body.light-skin .week-highlights {
    color: #8c8c96 !important;
}

.entry-image-full {
    position: fixed;
    z-index: 10000;
    height: 100%;
    width: 100%;
    background-color: hsla(0, 0%, 0%, 0.93) !important;
    top: 0;
    left: 0;
    cursor: pointer;
}
}
